{{
    config(
        materialized='ephemeral'
    )
}}

with smallest_bdd_base64 as (

    select
        100 as size,
        'AAAAAHAAAACR1RIAAwAAAAMAAAAAAAAAKICFAABgAAAAAAAAAAAAAP///////////////zAAAAAAAAAAAAAAAP///////////////zEAAAAAAAAAAAAAAAAAAAABAAAAAAAAAHgAAAAAAAAA2KDobg==' as base64

),

kb_bdd as (

    select
        1000 as size,
        '' as base64

),

kb_10_bdd as (

    select
        10000 as size,
        '' as base64

),

kb_100_bdd as (

    select
        100000 as size,
        '' as base64

),

mb_bdd as (

    select 1000000 as size,
    '' as base64

)

select * from smallest_bdd_base64
union all
select * from kb_bdd
union all
select * from kb_10_bdd
union all
select * from kb_100_bdd
union all
select * from mb_bdd
